import styled from "styled-components";

const ListingWrapper = styled.div`
  width: 100%;
  box-shadow: 0px 4px 14px rgba(0, 0, 0, 0.1);
  border-radius: 6px;
  padding: 30px 0 20px;
`;

export {ListingWrapper}
